import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";
import Login from "../src/pages/User/Login";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />}>
          <Login />
        </Route>
        {/* <Route path="/">
          <Home />
        </Route> */}
      </Routes>
    </Router>
  );
}

export default App;
